INSERT INTO `projectsNew` VALUES (1,7,'Jayaprakash Narayanan Memorial Trust ','Noida, Uttar Pradesh and Siwan, Bihar ','Vidya & Child: Arts & Performing Arts Programme ','Exposure to art is of great importance and helps expand a child’s vision, inculcate a sense of discipline and helps him/her dream. Through this project, children have the option to learn kathak, tabla, vocal music, theatre, art, craft and pottery. The eng','The JP Narayan Trust works towards providing a learning environment for children, who belong to marginalized socio-economic sections of society – a large majority of whose parents are illiterate/ semi-literate and work as domestic servants, industrial wor','250 ','INR 4,94,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/uNWuSF4WwXc'),(2,87,'Deep Griha Society ','3 urban slums: Pune City, Kasurdi Village and Deulgaongada village (Pune District) ','Creches for working mothers’ children ','This project is designed for children whose mothers are working as maids, rag pickers, vegetable/ fruit vendors, helpers in hospitals etc. In order to encourage children to go to school, Deep Griha Society offers to take care of children while their mothe','The benefits of the project is twofold: Mothers can take up jobs to improve the economic status of family and the education and safety of all the children in the family (including the youngest ones) is maintained. ','300 families; ie: 1200+ individuals ','INR 18,72,433 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/CcbnSarTldQ'),(3,12,'Let  Me Know ','Pan  India ','Awareness about opportunities among the youth ','This project is about creating an online pool of opportunities (scholarships, internships, events, competitions and more) across domains (technology, arts and design, business, entrepreneurship, sciences, medicine, sports and more) for students and fresh ','Youth, particularly those in Tier II and Tier III colleges, in India continue to remain uninformed about opportunities that can help them build skills and improve their career prospects. Internships, scholarships, events, workshops and competitions can he','10  million  (over  5  years) ','INR 20,00,000 (over  5  years) ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/U6cFrZEgX5k'),(4,18,'Let  Me Know ','Pan India ','Connecting organizers to the youth ','This project will reduce the gap between organizers of opportunities (companies, universities, nonprofits, international organizations, and government) and students/young professionals. The project hopes to build an easy and simple online interface for or','The project will provide organizers access to a larger talent pool for the opportunities they make available, which is at present, difficult to do so effectively. Further, the project aims to bring down advertising costs for SMEs/universities/nonprofits a','10,000 organizations (over 5 years) ','INR 15,00,000 (over 5 years) ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/Kfk-TPxLVL0'),(5,66,'New Resolution India ','Maharashtra ','Seed your Dreams (SYD) ','This programme hopes to make students sentient of their dreams. The project will explore the minds of the youth to different career options available thereby empowering the youth to make a career choice more efficiently and accurately. ','The backbone of the country is the youth, who comprise 45% of the nations population. The SYD project helps young people make independent, and fearless decisions about their life and career, and strives to create a generation of idealistic and innovative ','1200+ ','INR 20,65,400 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/32jpXPNlmqY'),(6,84,'Native Medicare Charitable Trust ','Tamil Nadu ','Sahanivasa ','Sahanivasa is an alternate home for children from lower economic sections of Tirupur in Tamil Nadu. The beneficiaries are 50 children (ages 3-14) from vulnerable situations such as broken homes, domestic violence, children of sex workers, children of migr','Parents work from 8am to 8pm, leaving the children with no option but to work with the parents or loiter outside of school. The child is denied the right to a real childhood (laughing, playing and being happy), entitlement of health, life education (exper','50 ','INR 11,45,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/2KxyxmXOjPs'),(7,49,'Kalinga Isntitute of Social Sciences ','Orissa, Chhatishgarh ','Sponsorship of Uniforms & Study Materials ','The project will ensure an in-house and better environment and to generate interest about education among the deprived tribal students at KISS. All the poor and deprived 1300 tribal students of 9th and 10th class of KISS will be provided with Uniform, stu','In India there is an amalgam of 437 Tribes and Orissa includes 62 of them. Total Tribal Population in India counts to 20 millions, out of which 7 millions (approx.), constituting 24% of the State’s total population reside in Orissa. Despite being a rich s','1300 tribal students ','INR 19,85,330 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/54x9n7eLog8'),(8,106,'Avanti Fellows ','Mumbai, Chennai, Delhi, Kanpur ','Broadening access to tertiary education ','Avanti Fellows identifies bright high school students from poor homes and provides them mentorship, training and financial aid in the years leading to university and continuing all through their years in university. Each Avanti Fellow is paired with his/ ','There is a systemic bias against poor students gaining admission to and succeeding at India’s premier universities. Students from poor homes have limited access to additional coaching for competitive exams due to the high fees charged for such tutoring, a','Primary beneficiaries: 150 in 2011, 550 in 2012, and 1000 in 2013 ','INR 30,40,000 (in 2012) ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/ViEBSoZH6M4'),(9,49,'SOS Children\'s Villages of India ','Pan India ','Family Home Sponsorship ','SOS Children’s Villages build families for children in need, help them shape their own futures and share in the development of their communities. The project is ongoing and the funds will be utilized to meet expenses incurred on the children such as food ','The basis and aim of the Family Home Sponsorship project is to respect, promote and stand up for children\'s rights. Along with SOS’s lobbying activities, the organization encourages children to actively take part in the decision-making processes that affe','6000 ','INR 5,40,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/KigTvXqetXA'),(10,79,'Literacy  India ','Gurgaon, Haryana, West Bengal & Rajasthan ','Assistance for skill-based training for youth ','Literacy India recognizes that an increasing number of young men and women are becoming restless, unfocused and resentful of their lives. This Gurgaonbased project will provide skill-based training to the youth according to their personal preferences to r','This project aims to guide the youth in the right direction so that they can achieve their goals in the future. The youth will become responsible citizens by allowing them to choose their own fields of training and to help them starting their own business','1000 households ','INR 10,08,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/UCZF1sXcejo'),(11,93,'Deep  Griha Society ','3 urban slums: Pune City, Kasurdi Village and Deulgaongada village (Pune District) ','City of Child: A Home for destitute children ','This City of Child is a Pune-based project that is aimed for orphans or children of single parents whose every need is provided in their ‘home away from home’ – education, shelter, food, medical care, entertainment, counseling etc. are met. Importance is ','The City of Child hostel provides a safe haven to children until Grade 10. Chil