iscriminated people are Dalit’s working in saltpan production under bondage, sex abuse, social evils, compulsion of work and very often human rights violence. They are voiceless, illiterate, and very poor and have no support in their development. Chi','550 members of 100 families ','INR 7, 70,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/221'),(122,14,'BN Srivastava Foundation ','Pan India ','Organizing handicrafts and social upliftment work among rural women ','The foundation will work for the village women to train them to improve their skill in handicraft (Sikki work, Bamboo work, Rassi work), folk art (Adivasi painting, Santhal, Mithila and Kohbar paintings) and merchandise their finished products. This proje','The villagers are dependent on agriculture, artisan, or labor work in big cities. This is part of the unorganized sector. Usually a village woman works in the agriculture sector or serving some rich families in and around their villages. They dream for a ','10,000 ','INR 62,00,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/222'),(123,11,'Akshara Centre ','Mumbai/Maharashtra; Advocacy at national level ','Empowering dreams scholarship program for higher education of underprivileged young women ','This project is aimed at young women of 15 to 22 years from underprivileged background, lower caste, Muslims. Financial scholarships for college fees combined with life skills and gender rights training would be given. 50- 100 girls are selected for the p','Most girls in Mumbai manage to get primary education. But once they finish their 10th standard (and often even before) parents find it difficult to send their girls to school. Akshara also provides these girls with tools to build their skills such as gend','500 adolescent girls and women ','INR 10,00,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/223'),(124,84,'Akshara Centre ','Mumbai/ Maharashtra ','Gender friendly Mumbai ','The project will cover the entire city of Mumbai. It aims to undertake safety audit of the city identifying various factors contributing to experiences of insecurity, violence that women experience in public spaces in Mumbai. The project will have compone','Mumbai is considered one of the safest city in India but gender safety is an issue that needs more attention. This is what led Akshara to lobby for the 103 police helpline dedicated to women, children and senior citizens. The huge number of calls on this ','About 49% of Mumbai’s population ','INR 33,39,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/224'),(125,84,'Kalinga Institiute of Social Sciences ','Orissa, Chhatishgarh ','Training of tribal/indigenous girls as medical/health attendants/paramedic ','The project aims towards providing training to tribal/indigenous girls in the field of health/ medical attendant/paramedic. The candidates will be selected from within the Kalinga Institute of Social Sciences as well as from the tribal dominated districts','The main objectives of the project are to provide employment and livelihood opportunities to tribal girls from the remotest corners of the state, to break the myth of girls being liabilities and training them to be economically independent and socially em','100 ','INR 15,40, 000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/225'),(126,34,'Umang Sunehra Kal Sewa Samiti','Hardoi, Uttar Pradesh','Economic empowerment of women in Hardoi','With a strong commitment to empower rural women economically, Umang has initiated an Agarbatti Rolling activity which bridges the need for a sustainable livelihood option for women and market opportunities. This programme of the project has partnered with','There is a need in the backward districts of UP to develop women based-business models (scalable in three years time) as a successful livelihood intervention. In the present scenario, ample market opportunities are available and it is very much possible t','550+ (in 17 villages)','INR 31,38,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/226'),(127,87,'FXB India Suraksha','Uppada Block in Vishakapatnam (Andhra Pradesh)','SE3W (Social Enterprises for Economic Empowerment of rural Women','This project will facilitate the creation of economically self sufficient women entrepreneurs in marginalized rural area across 25 fishing villages in the coastal belt of Vishakapatnam district in Andhra Pradesh. This will include capacity building and st','The identified coastal belt includes marginlaised communities living below the poverty line with a change of livelihood from traditional fishing to wage labour. The poor quality of life and low returns have further implications particularly on the women. ','750','INR 25,00,000','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/collection/1227/227'),(128,79,'Ashta Na Kai ','10 villages in Shirur Taluka, Pune, Maharashtra ','Bicycle Project ','The beneficiaries of this project will be 100 school girls in the Shirur Taluka villages of Pune in order to access distant village high school, usually 3-8 Km away. By providing a simple bicycle to each girl, not only is education easily accessible to th','Village girls often drop out after Std. 7 due to lack of high schools in their vicinity. Parents then see marriage as the solution to their daughter’s lack of focus. These girls then have their own daughters and granddaughters at a young age, creating a v','100 ','INR 3,55,000 ','jawahar.k@cii.in,sarbani.chakravarty@cii.in','https://source.unsplash.com/o2FCfhNSjPo');
